package model

//系列赛指数
type SeriesRate struct {
	Source     uint8             `json:"source"`      //来源平台 1雷竞技
	CreateTime int64             `json:"create_time"` //爬取时间
	SeriesId   string            `json:"series_id"`   //外部系列赛ID
	IsRoulette bool              `json:"is_roulette"` //是否有滚球
	Groups     []SeriesRateGroup `json:"groups"`      //该系列赛的玩法列表
}

type SeriesRateGroup struct {
	Id          string                `json:"id"`           //系列赛外部玩法ID
	Name        string                `json:"name"`         //玩法名
	Level       int32                 `json:"level"`        //1联赛 2系列赛 3小局
	GroupStatus int32                 `json:"group_status"` //1 开盘 2 锁盘 3封盘 4结算 5取消
	Stage       int32                 `json:"stage"`        //Level为小局时 代表第几局
	Items       []SeriesRateGroupItem `json:"items"`        //系列赛选项信息
}

type SeriesRateGroupItem struct {
	Id       string `json:"id"`        //外部选项ID
	Value    string `json:"value"`     //玩法选项的值
	Rate     string `json:"rate"`      //选项的指数
	InitRate string `json:"init_rate"` //选项的初始指数
	TeamId   string `json:"team_id"`   //队伍ID
	IsWin    int    `json:"is_win"`    //该选项是否获胜  0 选项没有结算，没有胜负 1 胜 2 负
}

//指数实时数据
type RateLiveData struct {
	Source     uint8 `json:"source"`      //来源平台 1雷竞技
	CreateTime int64 `json:"create_time"` //爬取时间

	UpdateTime  int64  `json:"update_time"`  //指数最后一次的更新时间
	GroupId     string `json:"group_id"`     //外部玩法ID
	ItemId      string `json:"item_id"`      //外部选项ID
	SeriesId    string `json:"series_id"`    //系列赛ID
	GroupStatus int32  `json:"group_status"` //1 开盘 2 锁盘 3封盘 4结算 5取消
	Stage       int32  `json:"stage"`        //99联赛玩法 100代表系列赛全局，1代表第一局
	Rate        string `json:"rate"`         //指数
}
